	public class GlossaryTerm : IEquatable<GlossaryTerm>
    {
            public string Level { get; set; }
            public string en_gb { get; set; }
            public string tLang { get; set; }

    		// Implement IEquatable<GlossaryTerm>
    		public bool Equals(GlossaryTerm other)
    		{
        		if (other is null)
            		return false;

        		return this.en_gb == other.en_gb;
    		}

		    // Override GetHashCode
    		public override int GetHashCode()
    		{
        		return this.en_gb.GetHashCode();
    		}

    		// Override Equals
    		public override bool Equals(object obj)
    		{
        		if (obj is GlossaryTerm other)
        		{
            		return Equals(other);
        		}
        		return false;
    		}
    }
